
Create table photographerInfo
(
Name VARCHAR(50) NOT NULL,
Email VARCHAR(200) NOT NULL,
Nid INT NOT NULL,
Picture IMAGE,
Username NVARCHAR(70) PRIMARY KEY,
Pass NVARCHAR(200) NOT NULL,
DOB NVARCHAR(50),
PresentAddress NVARCHAR(100),
Rating DECIMAL,
GOR DECIMAL
);


Create table clientInfo
(
Name VARCHAR(50) NOT NULL,
Email VARCHAR(200) NOT NULL,
Nid INT NOT NULL,
Picture IMAGE,
Username NVARCHAR(70) PRIMARY KEY,
Pass NVARCHAR(200) NOT NULL,
DOB NVARCHAR(50),
PresentAddress NVARCHAR(100)
);


Create table task
(
Client_Username VARCHAR(100) NOT NULL,
Photo Image,
Task_Details NVARCHAR(500),
Task_Status VARCHAR(50) NOT NULL,
Photographer_Name VARCHAR(100) NOT NULL,
Photographer_Username VARCHAR(100) NOT NULL,
Feedback_Rating Decimal
);


Create table complain
(
Complain_By NVARCHAR(100),
Details NVARCHAR(200),
ComplainStatus NVARCHAR(50),
Complain_To NVARCHAR(100),
hHandle_by NVARCHAR(100),
Reply NVARCHAR(200)
);


